                <br /> */}

{/* <Pagination
        currentPage={currentPage}
        totalDogs={storedDogs.length}
        dogsPerPage={dogsPerPage}
        setCurrentPage={setCurrentPage}
      /> */}
            </div>
        </div>
    )
}


export default Home;
